import {GET_ERRORS} from "../Types/Types";


const initialState = {};


export default function(state = initialState, action) {
    switch (action.type) {
        case GET_ERRORS:
            console.log("ERROR reducers")
            return {
                ...state,
              errors:  action.payload};
        default:
            return state;
    }
}
